import React from 'react';
import { useState } from 'react';

const FiltreVoiture = ({ listeVoitures }) => {

    console.log(listeVoitures)

    const faibleKilometrage = '';

    /*

    listeVoitures.map(voiture => (
        console.log(Math.min(voiture))
    ));*/

    const [filteredListeVoitures, setFilteredListeVoitures] = useState(listeVoitures);

    const filterByKm = km => {
        setFilteredListeVoitures(
            listeVoitures.filter(voiture => {
                return voiture.km === km
            }))
    }

    return (
        <div className="FiltreVoiture">
            <form>
                <label htmlFor="Kilometrage">Kilométrage</label>
                <input
                    type="range"
                    name="kilometrage"
                    min="1"
                    max="120"

                />
            </form>

        </div>
    );
};

export default FiltreVoiture;
